INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3001, 100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 0.0, "ヤマト", -416.5, 130011, 1, 2, 2.1, 3001100, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3001, 101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 0.0, "ヤマト", -416.5, 130011, 4, 2, 5.68, 3001101, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3001, 102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, "ヤマト", -416.5, 130011, 1, 1, 0.0, 3001102, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3002, 100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, "フブキ", -416.5, 130211, 1, 1, 0.0, 3002100, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3002, 101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, "フブキ", -416.5, 130211, 1, 1, 0.0, 3002101, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3002, 102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 0.0, "フブキ", -416.5, 130211, 5, 2, 8.53, 3002102, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3002, 103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 0.0, "フブキ", -416.5, 130211, 7, 1, 5.67, 3002103, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3002, 104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, "フブキ", -416.5, 130211, 1, 1, 0.0, 3002104, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3004, 300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, "フブキ", -416.5, 130211, 3, 3, 0.0, 3002300, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3005, 301, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, "フブキ", -416.5, 130211, 7, 7, 0.0, 3002400, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3003, 200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 0.0, "フブキ", -416.5, 130211, 2, 1, 4.4, 3003200, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3003, 201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, "フブキ", -416.5, 130211, 7, 7, 0.0, 3003201, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (3003, 202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 0.0, "フブキ", -416.5, 130211, 1, 2, 5.6, 3003202, "2030/01/01 14:59:59", "2024/10/31 12:00:00");
